Description:                               =
============================================

Return to a mesmerizing match-three wonderland in this gloriously remastered version of Jewel Match 2! Beautiful new HD graphics, new castles to build, 50 new levels (200 total!) and even fully featured Mahjong and other minigames are just a few of the additions. Try out the all-new move-limited play mode for a change of pace from the timed levels, or just sit back with no stress in the relaxed mode. Classic Jewel Match 2 gameplay has you battling crates, locked chains, and forces of magic as you rip through each level with an arsenal of power-ups. Collect coins and amulets to upgrade majestic castles as you go. It's the Jewel Match 2 you know and love, but you'll adore revisiting it in an all new way.

